import React from 'react';
import PropTypes from 'prop-types';

const ProfileAbout = ({
  profile: {
    bio,
    skills,
    user: { name }
  }
}) => {
  return (
    <div class='profile-about bg-light p-2'>
      <h2 class='text-primary'>John's Bio</h2>
      <p>
        Lorem ipsum dolor sit amet consectetur adipisicing elit. Omnis ea cumque
        atque distinctio, incidunt eligendi quis deleniti. A tempore atque harum
        deleniti reiciendis perferendis molestias, dolor officiis, expedita,
        sint dicta?
      </p>
      <div class='line'></div>
      <h2 class='text-primary'>Skill Set</h2>
      <div class='skills'>
        <div class='p-1'>
          <i class='fas fa-check'></i> HTML
        </div>
        <div class='p-1'>
          <i class='fas fa-check'></i> CSS
        </div>
        <div class='p-1'>
          <i class='fas fa-check'></i> JavaScript
        </div>
        <div class='p-1'>
          <i class='fas fa-check'></i> Python
        </div>
      </div>
    </div>
  );
};

ProfileAbout.propTypes = {};

export default ProfileAbout;
